package dto;

public class Session {
	private String s_user_id;
	private String s_user_name;
	private String s_user_idx;
	private String s_ip;
	
	public Session() {
		// TODO Auto-generated constructor stub
	}

	public String getS_user_id() {
		return s_user_id;
	}

	public void setS_user_id(String s_user_id) {
		this.s_user_id = s_user_id;
	}

	public String getS_user_name() {
		return s_user_name;
	}

	public void setS_user_name(String s_user_name) {
		this.s_user_name = s_user_name;
	}

	public String getS_user_idx() {
		return s_user_idx;
	}

	public void setS_user_idx(String s_user_idx) {
		this.s_user_idx = s_user_idx;
	}

	public String getS_ip() {
		return s_ip;
	}

	public void setS_ip(String s_ip) {
		this.s_ip = s_ip;
	}
	
}
